import React from "react";
import Item from "./Items";

export default function List({ blocktext, moveToNext, id }) {
  return (
    <div>
      {blocktext.map(
        (v, index) => (
          console.log(id + index),
          (
            <div
              className={
                v.id === 0 || v.id === 1 || v.id === 2 || v.id === 2
                  ? "hidden"
                  : ""
              }
            >
              <Item
                text={v.text}
                moveToNext={moveToNext}
                index={index}
                v={v}
                key={id + index}
              />
            </div>
          )
        )
      )}
      <button class="end">+ Add a card</button>
    </div>
  );
}
